    [],nt"num_tags": 47,nt"name": "montezuma-national-wildlife-refuge-annual-narrative-report-calendar-year-2002",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Montezuma
    National Wildlife Refuge outlines Refuge accomplishments during the 2002 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, and funding is given. Habitat management is
    also covered; subjects include wetlands, forests, croplands, grasslands, fire management,
    and pest control. The wildlife section of the report discusses wildlife diversity,
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, game mammals, fisheries resources, and marking and banding. The public
    uses of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, trapping, wildlife observation, and outdoor recreation.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, and equipment replacement. Cooperative
    programs and items of interest are provided at the end. Refuge brochures are attached.",nt"owner_org":
